import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
	return (
		<div className="topnav">
			<Link to="/">Home</Link>
			<Link to="/register">Register</Link>
			<Link to="/contact">Contact</Link>
			<Link to="/works">Works</Link>
		</div>
	);
};
export default Navbar;
